import React from 'react';
import { Fab } from '@material-ui/core';

function MainControls() {
    return (
        <Grid container spacing={2}>
            <Grid item>
                <Fab color="primary" size="small"> -1 </Fab>
            </Grid>
            <Grid item xs>
                <Fab color="primary">Play</Fab>
            </Grid>
            <Grid item>
                <Fab color="primary" size="small"> +1 </Fab>
            </Grid>
        </Grid>
    );
}

export default MainControls;
